window.takeScreenshot=function(n,t){html2canvas(document.querySelector(t),{allowTaint:!0,scale:.1,useCORS:!0}).then(async t=>{var r=t.toDataURL("image/jpeg",.7).toString();for(i=0;i<r.length;i=i+1e3)await n.invokeMethodAsync("AppendData",r.substring(i,Math.min(r.length,i+1e3)));await n.invokeMethodAsync("SubmitData")})}